import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class LccLinkTile extends React.Component {
  render() {
    return (
      <Link to={this.props.to} >
        <h3>{this.props.tileHeader}</h3>
        <p>{this.props.description}</p>
      </Link>
    );
  }
}
